import './App.css';
import Root from '../pages/Root';
import { Route, createBrowserRouter,createRoutesFromElements, Router } from 'react-router-dom';

const router = createBrowserRouter(createRoutesFromElements(
  <Route path="/" element={<Root/>}></Route>
  ));

function App() {
  return (
    <Router router={router}/>
  );
}

export default App;
